        <thead>
          <tr style = {styleGray}>
            <th scope="col">Property</th>
            <th scope="col">Value</th>
          </tr>
        </thead>
        <tbody>

        <tr>
        <td>Name</td>
        <td>                 
                <input type='text' name='ride_name' onChange={(e) => {

                }}></input> </td>
        </tr>

       
        
        </tbody>

        </table>
                    </InfoContainer>    
 
        </Border>
    )
}

export default LeftThird
